<span class="token comment">// \u8C03\u7528\u539F\u578B\u65B9\u6CD5\uFF0C\u4F46\u662F this \u6307\u5411\u7684\u662F\u8C03\u7528\u7684\u5BF9\u8C61\uFF0C\u5373 rabbit\uFF0C\u56E0\u6B64\u4E3A rabbit \u521B\u5EFA\u5C5E\u6027 isSleeping</span>
